import Tilt from 'react-tilt';
import './logo.css';

const Logo = () => {

	return(
	<div>
		<Tilt className="Tilt" options={{ max : 70}} style={{ height: 150, width: 150 }} >
	 		<div className="Tilt-inner shadow-5 ma3 pa4 logo">@ </div>
		</Tilt>
	</div>
	);
}
export default Logo;
